Framescript.script:
exportRoot.stop();

setTimeout(change_storytext, 10);
setTimeout(read_storytext, 500); //extra delay on pg1 for loading

exportRoot.btn_screen1.removeAllEventListeners("mousedown");
exportRoot.btn_screen1.addEventListener("mousedown", goto_screen2);
addHandHover(exportRoot.btn_screen1);

begin_pulseObj(exportRoot.btn_screen1);

var fromFirst = true;

function goto_screen2(e) {
	//console.log("goto_screen2");
	playSfx('sfx_btnclick');
	
	end_pulseObj(exportRoot.btn_screen1);	
	
	removeHandHover(exportRoot.btn_screen1);
	cursorDefault();
	exportRoot.btn_screen1.removeEventListener("mousedown", goto_screen2);
	
	exportRoot.gotoAndStop("screen2");
}

exportRoot.stop();

setTimeout(change_storytext, 10);
setTimeout(read_storytext, 10);

exportRoot.btn_replay.mouseChildren = false;
exportRoot.kara2.mouseChildren = false;
exportRoot.btn_next.mouseChildren = false;
exportRoot.btn_prev.mouseChildren = false;

exportRoot.btn_replay.visible = false;
exportRoot.btn_replay.removeAllEventListeners("mousedown");
exportRoot.btn_replay.addEventListener("mousedown", function (e) {
	e.currentTarget.visible = false;
	playSfx("click6");
	exportRoot.kara2.gotoAndPlay(0);
	exportRoot.btn_exercise.visible = true;
	exportRoot.btn_exercise.gotoAndPlay("enab");
	exportRoot.heart.gotoAndPlay(0);
	exportRoot.calendar2.gotoAndStop(0);
	setTimeout(read_storytext, 10);
});
addHandHover(exportRoot.btn_replay);


exportRoot.kara2.removeAllEventListeners("mousedown");
exportRoot.kara2.addEventListener("mousedown", function (e) {
	if (exportRoot.calendar2.ready) {
		exportRoot.kara2.mouseEnabled = false;
		exportRoot.kara2.play();
		exportRoot.calendar2.play();
		exportRoot.calendar2.ready = false;
		exportRoot.btn_exercise.gotoAndStop("disab");
	}
});
exportRoot.kara2.hitArea = new createjs.Shape(new createjs.Graphics().f("#000").dr(-40, -30, 360, 470));
addHandHover(exportRoot.kara2);

exportRoot.karaCompleteJumps = 5;

enableBtn(exportRoot.btn_next, false);

exportRoot.btn_exercise.visible = true;
if (!exportRoot.fromFirst) { exportRoot.btn_exercise.gotoAndPlay("enab"); }
fromFirst = false;
//exportRoot.btn_exercise.mouseEnabled = false;

exportRoot.stop();

setTimeout(change_storytext, 10);
setTimeout(read_storytext, 10);

exportRoot.kara3.mouseChildren = false;

exportRoot.btn_replay.visible = false;
exportRoot.btn_replay.removeAllEventListeners("mousedown");
