	e.currentTarget.visible = false;
	playSfx("click6");
	exportRoot.karaCompleteJumps = 14;
	exportRoot.kara3.gotoAndPlay(0);
	exportRoot.btn_exercise.visible = true;
	exportRoot.btn_exercise.gotoAndPlay(0);
	exportRoot.muscles.gotoAndStop(0);
	exportRoot.calendar3.gotoAndStop(0);
	setTimeout(read_storytext, 10);
});
addHandHover(exportRoot.btn_replay);


exportRoot.kara3.removeAllEventListeners("mousedown");
exportRoot.kara3.addEventListener("mousedown", function (e) {
	if (exportRoot.calendar3.ready && exportRoot.muscles.ready) {
		exportRoot.kara3.mouseEnabled = false;
		exportRoot.kara3.play();
		exportRoot.calendar3.play();
		exportRoot.calendar3.ready = false;
