addHandHover(exportRoot.btn_replay);


exportRoot.kara4.removeAllEventListeners("mousedown");
exportRoot.kara4.addEventListener("mousedown", function (e) {
	exportRoot.kara4.mouseEnabled = false;
	exportRoot.kara4.play();
	exportRoot.btn_exercise.gotoAndStop("disab");
