exportRoot.kara4.hitArea = new createjs.Shape(new createjs.Graphics().f("#000").dr(-40, -30, 360, 470));
addHandHover(exportRoot.kara4);

exportRoot.karaCompleteJumps = 4;

enableBtn(exportRoot.btn_next, false);

exportRoot.btn_exercise.visible = true;
exportRoot.btn_exercise.gotoAndPlay("enab");

btn_next = this.btn_next;
btn_next.removeAllEventListeners("mousedown");
btn_next.addEventListener("mousedown", btn_next_clicked);
addHandHover(btn_next);

btn_prev = this.btn_prev;
btn_prev.removeAllEventListeners("mousedown");
btn_prev.addEventListener("mousedown", btn_prev_clicked);
addHandHover(btn_prev);

function btn_next_clicked(e) {
	sndch.stop(); //stop narration
	stopSfx(); //stop playing sfx
	playSfx('sfx_btnclick');

	//console.log("btn_next_clicked");
	//console.log("leaving currentLabel: " + exportRoot.getCurrentLabel());

	switch (exportRoot.getCurrentLabel()) {
		case "screen1":
			{
				exportRoot.gotoAndStop("screen2");
				break;
			}
		case "screen2":
			{
				exportRoot.kara2.removeAllEventListeners("mousedown");
				exportRoot.gotoAndStop("screen3");
				break;
			}
		case "screen3":
			{
				exportRoot.kara3.removeAllEventListeners("mousedown");
				exportRoot.gotoAndStop("screen4");
				break;
			}
		case "screen4":
			{
				exportRoot.kara4.removeAllEventListeners("mousedown");
				exportRoot.btn_next.visible = false;
				exportRoot.gotoAndStop("screen5");
				break;
			}
		case "screen5":
			{
				location.href = "../index.html";
				break;
			}
		default:
			//console.log("don't know where to go!");
			break;
	}
	//change_storytext(); //in storytext.js
}

function btn_prev_clicked(e) {
	sndch.stop();
	stopSfx(); //stop playing sfx
	playSfx('sfx_btnclick');

	//console.log("btn_prev_clicked");
	//console.log("leaving currentLabel: " + exportRoot.getCurrentLabel());

	switch (exportRoot.getCurrentLabel()) {
		case "screen2":
			{
				exportRoot.kara2.removeAllEventListeners("mousedown");
				exportRoot.btn_replay.removeAllEventListeners("mousedown");
				exportRoot.gotoAndStop("screen1");
				break;
			}
		case "screen3":
			{
				exportRoot.kara3.removeAllEventListeners("mousedown");
				exportRoot.gotoAndStop("screen2");
				break;
			}
		case "screen4":
			{
				exportRoot.kara4.removeAllEventListeners("mousedown");
				exportRoot.gotoAndStop("screen3");
				break;
			}

		case "screen5":
			{
				exportRoot.btn_next.visible = true;
				exportRoot.gotoAndStop("screen4");
				break;
			}
		default:
			//console.log("don't know where to go!");
			break;
	}
	//change_storytext(); //in storytext.js
}

